import React, { useState } from 'react';
import { BrowserRouter as Router} from "react-router-dom"
import { Link } from "react-router-dom"
import './App.scss';
import { Hello } from "./components/hello/hello"
import { Button } from "./components/Button/Button"

function App() {
  const [clicked, setClicked] = useState<Boolean>();

  const [name, setName] = useState<String>("Sanzhar");

  const btnClickLoginHandler = () => { 
    console.log("Log in clicked") 
    setClicked(true);
  }

  const btnClickNameHandler = () => { 
    console.log("Change name clicked") 
  }

  return (
    <Router>
      <div className="App">
        <div className="App-wrapper">
          { clicked ? <Hello name={ name } /> : null}
          <Button className="App-login-btn" clickHandler = { btnClickLoginHandler } text="Log in"/>
          <Button className="App-login-btn" clickHandler = { btnClickNameHandler } text="Change name"/>
        </div>
      </div>
    </Router>
  );
}

export default Router(App);
